lic_transport:1,C5_Flag:1,C5_Notes:null,C6_Flag:1,C6_Notes:'"Austria banned its nearly 9 million citizens on March 16 from entering public spaces except in certain situations, such as pharmacy, grocery store and ATM trips. All sports fields have been shut, but people are still permitted to go on runs or take walks outside with the people who also live in their apartment or house." (https://www.dw.com/en/coronavirus-what-are-the-lockdown-measures-across-europe/a-52905137; http://web.archive.org/web/20200528133101/https://time.com/5816129/austria-rollback-lockdown/)    "By March 16, leaving home was banned by law with limited exceptions, restaurants and shops not delivering daily products were closed, and enforced by administrative and police measures, and a number of communities and regions were declared risk areas and put under quarantine" (http://web.archive.org/web/20200528135324/https://www.imf.org/en/Topics/imf-and-covid19/Policy-Responses-to-COVID-19)',C6_Stay_at_home_requirements:2,C7_Flag:0,C7_Notes:null,C7_Restrictions_on_internal_movement:2,C8_International_travel_controls:3,C8_Notes:null,ContainmentHealthIndex:77.27,ContainmentHealthIndexForDisplay:77.27,E1_Flag:null,E1_Income_support:0,E1_Notes:null,E2_Debt_or_contract_relief:2,E2_Notes:"Broad relief package with suspension on interest payments, partial release of obligation to pay rent etc. (http://web.archive.org/web/20200528142508/https://investinaustria.at/en/news/2020/03/corona-aid-package-economy-details.php;https://iclg.com/briefing/11275-consequences-of-the-current-situation-regarding-covid-19-for-tenants-and-landlords; http://web.archive.org/web/20200528142504/https://metropole.at/how-the-coronavirus-will-affect-your-business-in-austria/)",E3_Fiscal_measures:0,E3_Notes:null,E4_International_support:0,E4_Notes:null,EconomicSupportIndex:50,EconomicSupportIndexForDisplay:50,GovernmentResponseIndex:73.08,GovernmentResponseIndexForDisplay:73.08,H1_Flag:1,H1_Notes:null,H1_Public_information_campaigns:2