s:null,C4_Flag:1,C4_Notes:null,C4_Restrictions_on_gatherings:4,C5_Close_public_transport:0,C5_Flag:null,C5_Notes:null,C6_Flag:0,C6_Notes:null,C6_Stay_at_home_requirements:2,C7_Flag:0,C7_Notes:null,C7_Restrictions_on_internal_movement:2,C8_International_travel_controls:4,C8_Notes:null,ContainmentHealthIndex:67.42,ContainmentHealthIndexForDisplay:67.42,E1_Flag:0,E1_Income_support:2,E1_Notes:'The measure in Germany that allows people to reduce work time but keep their job is called "Kurzarbeit" or "Kurzarbeitergeld".  This is not translated in the below.  As of 22 April 2020 the policy was extended as follows:    "  -Kurzarbeitergeld is increased, depending on the duration of the short-time work. So far, the Federal Employment Agency has paid 60 percent of the loss of wages for short-time work and 67 percent for parents.  -From the fourth month of receipt, the Kurzarbeitergeld for childless employees who are currently working at least 50 percent less will be increased to 70 percent and from the seventh month of receipt to 80 percent of the loss of earnings.  For employees with children who are currently working at least 50 percent less, the increase is 77 percent from the fourth month of receipt and 87 percent from the seventh month of receipt.  These increases apply until December 31, 2020 at the most.  "    (see https://web.archive.org/web/20200430170217/https://www.bundesfinanzministerium.de/Content/DE/Standardartikel/Themen/Schlaglichter/Corona-Schutzschild/2020-03-19-Beschaeftigung-fuer-alle.html)    Individual employees can get Kurzarbeitergeld up to a period of 21 months.    The measure will end on 31 December 2020.  Unless the measure is terminated unexpectedly at an earlier point in time, no comments are added to the database.',E2_Debt_or_contract_relief:2,E2_Notes:null,E3_Fiscal_measures:0,E3_Notes:null,E4_International_support:0,E4_Notes:null,EconomicSupportIndex:87.5,EconomicSupportIndexForDisplay:87.5,GovernmentResponseIndex:70.51,GovernmentResponseIndexFo