c_events:2,C3_Flag:1,C3_Notes:null,C4_Flag:1,C4_Notes:'At the federal level, gatherings of up to 10 people is allowed (see note on 25 May 2020).  Most individual states, allow up to the federal level.  Few still have stricter local rules in place (e.g. Berlin only allows gatherings of up 5 people from different families).  Despite some such local stricter regimes, "3G" seems to capture the overall situation best.    (see http://web.archive.org/web/20200606081448/https://www.morgenpost.de/politik/article228706533/Corona-Regeln-im-Ueberblick-Das-gilt-in-Ihrem-Bundesland.html for an overview as of 5 June 2020).',C4_Restrictions_on_gatherings:3,C5_Close_public_transport:0,C5_Flag:null,C5_Notes:null,C6_Flag:null,C6_Notes:null,C6_Stay_at_home_requirements:0,C7_Flag:null,C7_Notes:null,C7_Restrictions_on_internal_movement:0,C8_International_travel_controls:3,C8_Notes:'According to official information from the federal government a ban for non-essential travel continues following general EU guidelines until at least 15 June 2020:  "Like other European countries, Germany will continue to apply the travel restrictions in the Schengen area decided on 17 March 2020 by the EU Heads of State and Government until 15 June 2020."    (see http://web.archive.org/web/20200606074324/https://www.auswaertiges-amt.de/en/-/2320738)  ',ContainmentHealthIndex:54.55,ContainmentHealthIndexForDisplay:54.55,E1_Flag:0,E1_Income_support:2,E1_Notes:null,E2_Debt_or_contract_relief:1,E2_Notes:null,E3_Fiscal_measures:0,E3_Notes:null,E4_International_support:0,E4_Notes:null,EconomicSupportIndex:62.5,EconomicSupportIndexForDisplay:62.5,GovernmentResponseIndex:55.77,GovernmentResponseIndexForDisplay:55.77,H1_Flag:1,H1_Notes:null,H1_Public_information_campaigns:2,H2_Notes:null,H2_Testing_policy:3,H3_Contact_tracing:1,H3_Notes:null,H4_Emergency_investment_in_healthcare:0,H4_Notes:null,H5_Investment_in_vaccines:0,H5_Notes:null,M1_Notes:null,M1_Wildcard:null,StringencyIndex:50,StringencyIndexForDisplay:50,Stri